commits.content:
:root {
    --font-color: white;
    --backgroundOf-feature: rgb(25, 28, 36);
}

body {
    background: black;
}

@media (max-width:538px) {

    .card-body1 {
        display: flex;
        flex-direction: column !important;
    }

    .rightCtn,
    .leftCtn {
        width: 100% !important;
        margin-top: 20px;
    }
}

@media (max-width:1118px){
    .leftCtn{
        flex-direction: column !important;
        justify-content: space-between !important;
    }

}


.card {
    background: var(--backgroundOf-feature);
    border-radius: 8px;
    margin: 20px;
    color: var(--font-color);
}

.syntax_generator {
    border: none;
    padding: 15px;
    color: var(--font-color);
    background: var(--backgroundOf-feature);
    font-weight: 450;
    margin: 10px;
}

.active {
    background: rgb(42, 48, 56);
    border: 1px solid var(--font-color);
    border-radius: 12px;
    box-sizing: border-box;
    box-shadow: rgba(198, 195, 195, 0.35) 0px 5px 10px;
}

option {
    border-radius: 8px;
    border: none;
}

select ,.textbox{
    background-color: rgb(42, 48, 56);
    padding: 7px;
    border-radius: 8px;
    color: var(--font-color);
}

.card1 {
    border-radius: 8px;
    border: 1px solid var(--font-color);

}

.card-body1 {
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    margin: 4%;
}

.generatedCode {
    background-color: rgb(42, 48, 56);
    border-radius: 8px;
    width: 100%;
    height: 500px;
    font-size: larger;
}

.rightCtn {
    width: 50%;
}

.leftCtn {
    border: 1px solid #ccc;
    opacity: 0.5;
    border-radius: 8px;
    padding: 10px;
    width: 45%;
    display: flex;
    flex-direction: row;
    justify-content: space-around;
}

.textAndButtonContainer {
    display: flex;
    justify-content: space-between;
}

.textPlusDropdown1,.textPlusDropdown2{
    display: flex;
    flex-direction: column;
    margin: 5px;
}

.dropdownList{
    list-style: none;
    padding: 5px;
    margin: 0;
    border: 1px solid rgb(32, 112, 186);
    max-height: 150px;
    overflow-y: auto;
    position: absolute;
    width: 200px;
    display: none;
  .suggestions-list li {
    padding: 5px 10px;
    cursor: pointer;
  }
  .suggestions-list li:hover {
    background: #eee;
  }
}
